      " [21] 574,Some background on this: C++ supports multiple inheritance  but C# does not. Multiple inheritance in C++ has always be controversial  because the resolution of multiple inherited implementations of the same method from different base classes is hard to control and anticipate. C# decided to avoid this problem by allowing a class to implement multiple interfaces  which do not contain method implementations  but restricting a class to have at most a single parent class. Although this can result in redundant implementations of the same method when different classes implement the same interface  it is still an excellent compromise.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   \n",
