      "[200] 1220,The root cause of class conflict its possessiveness or the acquisitive instinct. So long as the ideal that is to be achieved is one of securing the maximum material satisfaction  possessiveness is neither suppressed nor eliminated but grows on what it feeds. Nor does it cease to be such - it is possessiveness  still  whether it is confined to only a few or is shared by many.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   \n",
      "[201] 1072,In unmanaged environments the compiler and linker directly compile the source code in to native instructions that are targeted at a specific processor. The disadvantage of this process is that each time you want to run your executable on a different platform you will have to re-compile the code using a compiler and linker that will compile the code that is targeted at the specific hardware. This means that each time you want your application to run on a different platform  you will have to ship the compiled instructions again and again. As this leads to compiling and maintaining multiple versions of the same application  the companies try to create a more generalized compiled version in order to target most of the environments. This process is known as the Lowest Common Denominator approach. This leads to a more generalized program which is not optimized properly and does not take advantages of the underlying hardware infrastructure (processor  cache  etc). Because the CLR supplies one or more Just in Time Compiler for each computer architecture it supports  the same set of MSIL can be JIT-compiled and run on any supported architecture.                                                                                                                                                                                                                                                                                                                                                                                                                          \n",
